[EroticaX] -  Penny Brooks - Love Song - NEW 10 APRIL 2015 NEW

'You say I'm just a dream...' sings Penny Brooks as she strums her guitar while sitting on the bed in this dream-like tale of longing and fulfillment. James Deen listens to her words and proves that she's more than just a dream, taking her in his arms and proving just how real it all is. 

